import React, { useEffect, useState } from "react";
import { Radar } from "react-chartjs-2";
import usePlayers from "../../hooks/skrallgaming/usePlayers";
import playersArray from "../../globals/skrallgaming/players"
import "../../assets/style/skrallgaming/playerlist.css"

export default function PlayerList(){

    const { players, setPlayers } = usePlayers()
    const [ currentSortBy, setCurrentSortBy ] = useState("Rank")
    const [ playerInfo, setPlayerInfo ] = useState({})

    useEffect(() => {
        let newArray = [...playersArray]
        for (let i = 0; i < newArray.length; i++){
            newArray[i].rank = i+1
        }
        console.log("whaat", newArray)
        setPlayers(newArray)
    }, [setPlayers])

    const openPlayer = (player) => {
        //const player = players.find(p => p.name === playerName)
        console.log(player)
    }

    const sort = (sortBy) => {
        let newArray = [...players]
        let type
        
        for (let i = 0; i < newArray.length; i++){
            if (newArray[i][sortBy] !== undefined && newArray[i][sortBy] !== ""){
                type = typeof newArray[i][sortBy]
                break;
            }
        }
        
        if (type === "string"){
            if (currentSortBy === sortBy) newArray.sort((a, b) => (b[sortBy] ?? "öö") > ( a[sortBy] ?? "öö") ? 1 : -1)
            else newArray.sort((a, b) => (b[sortBy] ?? "öö") < ( a[sortBy] ?? "öö") ? 1 : -1)
        }
        else{
            if (currentSortBy !== sortBy) newArray.sort((a, b) => b[sortBy] - a[sortBy])
            else newArray.sort((a, b) => a[sortBy] - b[sortBy])
             
        }
        if (currentSortBy === sortBy) setCurrentSortBy("")            
        else setCurrentSortBy(sortBy)
        setPlayers(newArray)
    }
    
    return <>
        <div className="listBody">
        <table className="content-table">
            <thead>
            <tr>
                <th onClick={() => sort("name")}>Player</th>
                <th onClick={() => sort("rank")}>Rank</th>
                <th onClick={() => sort("rating")}>Smash Rating</th>
                <th onClick={() => sort("main")}>Main</th>
                <th onClick={() => sort("secondary")}>Secondary</th>
                <th onClick={() => sort("beerPong")}>Beer Pong Rating</th>
            </tr>
            </thead>
                <tbody>                        
                    { Array.isArray(players) && 
                        players.map((player, index) => (
                            <tr onClick={() => openPlayer(player)}>
                                <td>{player.name}</td>
                                <td>{player?.rank}</td>
                                <td>{player.rating}
                                    {player.placementGames > 0 &&
                                        <span className="placementGames">{player.placementGames}</span>
                                    }
                                </td>
                                <td>{player.main || ""}</td>
                                <td>{player.secondary || ""}</td>
                                <td>{player.beerPong || ""}</td>
                            </tr>
                        ))
                    }                          
                </tbody>
        </table>
        { playerInfo !== {} &&
            <div className="playerInfo">
                <div>
                    <h1>MIKKA</h1> 
                    <p>A.K.A - <i>Mikka Tronkinen, Steeve The Speed</i></p>
                    <br />
                    <h3>Is one of Skrallgaming's founders and a veteran in the smash community since the <i>SS3B</i> times. 
                        He's currently ranked #1 and is one of two players above 1600 rating and may because of that be considered one of two gods.
                        Mikka is a fan of lightweighted characters such as <i>Mewtwo, Jigglypuff</i> and <i>Ness</i>, 
                        which fits his plastyle of wanting to fight off-stage. 
                        Although, in a 2v2-format with no 'team damage' he's said that he prefers heavier characters which is why he played 
                        <i>Ike</i> through most of 2017. Lately it has been some rumours and controversy of Mikka practicing Hero and Byleth for SSE-II 2020.
                        <br /><br />Placings: 
                        <ul>
                            <li>2nd at SSE-II | 2019 (Doubles)</li>
                            <li>1st at SSE-II | 2018 (Doubles)</li>
                            <li>2nd at SSE-II | 2017 (Doubles)</li>
                            <li>1st at SSE-LI | 2017 (Melee Doubles)</li>
                            <li>5th at SSE-LI | 2017 (Doubles)</li>
                            <li>1st at SSE-MI | 2016 (Singles)</li>
                        </ul> 
                    </h3>
                </div>
            </div>
        }
        </div>
    </>
}
